            repudiandae ipsam earum quidem aut dolore vel a. Quos, pariatur
            quisquam? Accusantium.
          </p>
          <img
            src="https://isdi.in/blog/wp-content/uploads/2021/07/Interior-Material-Combinations.jpg"
            alt=""
            className="flex-1 w-full h-96 object-cover"
          />
        </div>
      </div>
      <ProjectSection />
      <Footer />
    </div>
  );
}

export default App;
